import React, {useState, useEffect} from 'react'
import {Paper,Stepper,Step, StepLabel, Typography, CircularProgress, Divider, Button, CssBaseline} from "@material-ui/core";
import useStyles from './styles';
import AdressForm from './AdressForm';
import PaymentForm from './PaymentForm';
import { Link } from 'react-router-dom';
import verifyIfTokenIsExpired from "../Services/UserCheck"

import {Input, Modal} from "@material-ui/core";
import axios from "axios";
import Box from "@mui/material/Box";


const steps= ['Shipping adress', 'Payment details']

function Checkout(props) {
    const {cartItems} =props;
    const [activeStep, setActiveStep]= useState(0);
    const classes = useStyles();
    const [shippingData, setShippingData]= useState({})



    const Confirmation = () => (
        <>
        <div>
            <Typography variant= "h5">Thank you for your purchase </Typography>
            <Divider className= {classes.divider}/>
            <Typography variant= "subtitle2"></Typography>
        </div>
        <br/>
        <Button component= {Link} to="/" variant="outlined" type= "button" >Back to Home</Button>
        </>
    );


    const handleOpenModal = () => setOpen(true);
    const handleCloseModal = () => {setOpen(false)};
    const nextStep = () => setActiveStep((prevActiveStep) => prevActiveStep +1)
    const backStep = () => setActiveStep((prevActiveStep) => prevActiveStep -1)
    const next= (data)=> {
        setShippingData(data);
        nextStep();
    }

    const Form = ()=> activeStep === 0
    ? <AdressForm next={next}/>
    : <PaymentForm shippingData={shippingData} cartItems={cartItems} backStep= {backStep} shippingData = {shippingData} nextStep= {nextStep}/>

    if(verifyIfTokenIsExpired) {
        return (
            verifyIfTokenIsExpired() && <>
               <CssBaseline/>
                 <div className={classes.toolbar}/>
                <main className= {classes.layout}>
                    <Paper className= {classes.paper}>
                        <Typography variant= "h4" align = "center">Checkout</Typography>
                        <Stepper activeStep={activeStep} className= {classes.stepper}>
                            {steps.map((step)=> (<Step key= {step}>
                                <StepLabel>{step}</StepLabel>
                            </Step>))}
                        </Stepper>
                        {activeStep=== steps.length ? <Confirmation/> : <Form/>}
                    </Paper> 
                </main>
            </> 


        )
    } else {
            return (
                <Modal
            open={open}
            onClose={() => {handleCloseModal(); setAlert(false)}}
            aria-labelledby="modal-modalLogIn"
            aria-describedby="modal-descriere"
          >
            <Box sx={style}>
              <Box
                style={{
                  display: "flex",
                  flexDirection: "column",
                  justifyContent: "center",
                  alignItems: "center",
                }}
                component="form"
                sx={{ "&.MuiTextField-root": { m: 1, width: "25ch" } }}
                noValidate
                autocomplete="off"
              >
                <Input
                  onChange={updateUsername}
                  required
                  value={username}
                  id="username"
                  placeholder="Enter your username"
                  size="small"
                />
                <Input
                  onChange={updatePassword}
                  required
                  value={password}
                  id="password"
                  label="Password"
                  type="password"
                  placeholder="Enter your password"
                  size="small"
                />
                {alert ? (
                  <Alert variant="filled" severity="error">
                    This is an error alert — check it out!
                  </Alert>
                ) : (
                  ""
                )}
              </Box>
              <Stack
                style={{
                  display: "flex",
                  alignItems: "center",
                  margin: "30px",
                  justifyContent: "center",
                }}
                spacing={2}
                direction="row"
              >
                <button onClick={login} type="submit">
                  Log In
                </button>
                <button onClick={()=>{handleCloseModal();setAlert(false)}} variant="text" color="error">
                  Cancel
                </button>
              </Stack>
            </Box>
          </Modal>
            )
    }


}

export default Checkout
